import { Route, Switch } from 'react-router-dom'
import React from 'react'

const AdRoutes = () => {
  return (
    <Switch>
      <Route path="/advertisements/:id/updates" render={() => <h1>Updating</h1>}/>
    </Switch>
  )
}

export default AdRoutes
